import styles from "../../styles/NavBar.module.css";
const NavBar = () => {
  return (
    <div className={styles.back}>
      <p style={{ paddingLeft: "5%" }}>About</p>
      <p className={styles.section}>Experience</p>
      <p className={styles.section}>Projects</p>
    </div>
  );
};

export { NavBar };
